<script>
export default {
	props: {
		countryFilter: {
			type: String,
			required: true
		},
		visited: {
			type: Array,
			required: true
		}
	},
	mounted() {
		this.active()
	},
	methods: {
		changeActive(e) {
			this.$emit('changeCountry', e.target.id)
			this.$nextTick(() => {
				this.active()
			})
		},
		active() {
			this.$el.querySelectorAll('path').forEach((el) => {
				el.classList.remove('active')
			})
			this.$el.querySelector('#' + this.countryFilter).classList.add('active')
		}
	}
}
</script>

<style>
path {
	fill: #DADAD8;
}

path:hover {
	fill: #5C4B51;
}

.visited {
	fill: #4A9690;
}

.active {
	fill: #5C4B51;
}
</style>
